import React, { Component } from "react";
import "./landing.css";
import { Link } from "react-router-dom";

class Landing extends Component {
  render() {
    return (
      <div id="landing">
        <div id="banner">
          <h1>LAUREL DENTINGER</h1>
          <p>DESIGNER | DEVELOPER</p>
          <Link to="/projects">
            <button>Enter Site</button>
          </Link>
        </div>
      </div>
    );
  }
}

export default Landing;
